INSERT INTO `auctions` (`id`, `name`, `description`, `bid_start`, `bid_min`, `buy_price`, `offer_start`, `offer_end`, `winner`) VALUES
(1, 'My personal trainer', 'My personal trainer– Web application. Εφαρμογή για smart phones, i-phones και tablets, η οποία θα παρέχει πληροφορίες και προγράμματα προπόνησης για ποδόσφαιρο στοχευμένα για συγκεκριμένες κατηγορίες- επίπεδα αθλητισμού (π.χ. ανάλογα με την ηλικία).\r\n', 1, 2, 3500, '2015-09-30 19:09:00', '2015-11-30 19:09:00', 0),
(2, 'VR', 'VR - Μέθοδος αποκατάστασης για άτομα με χρόνιες παθήσεις σε συνδυασμό με εικονική πραγματικότητα. Παροχή εξοπλισμού και υπηρεσιών που συνδέουν τα όργανα εκγύμνασης με σύστημα εικονικής πραγματικότητας, σε κέντρα αποκατάστασης για άτομα με χρόνιες παθήσεις και κινητικές δυσλειτουργίες, αξιοποιώντας τα οφέλη της εικονικής πραγματικότητας.', 5, 3, 3000, '2015-09-30 19:11:00', '2016-02-04 12:03:00', 0),
(3, 'Streaminyou.gr', 'Streaminyou.gr – Live streaming εκδηλώσεων. Παροχή υπηρεσιών μετάδοσης εικόνας και ήχου μέσω του διαδικτύου (live streaming και web TV) σε απομακρυσμένες περιοχές της ελληνικής επαρχίας.', 1, 1, 500, '2015-09-30 19:13:00', '2015-12-31 19:13:00', 0),
(4, 'HPV', 'HPV- Ανίχνευση και τυποποίηση του ιού HPV. Εμπορική αξιοποίηση τεχνολογίας - μεθόδου η οποία ανιχνεύει και τυποποιεί εννέα τύπους HPV και περιπτώσεις καρκίνου του τραχήλου της μήτρας. Η τεχνική αυτή παρουσιάζει εξαιρετική ευαισθησία και ειδίκευση, δίνοντας αποτελέσματα σε σύντομο χρονικό διάστημα.', 25, 3, 32, '2015-09-30 19:13:00', '2016-01-30 12:03:00', 0),
(5, 'NATUREPLUS', 'NATUREPLUS – Παραγωγή φυσικών βιοενεργών συστατικών. Κατασκευή και προμήθεια βιοδραστικών ενώσεων από μικροφύκη, σε εταιρίες τροφίμων. Τα προϊόντα αυτά θα περιέχουν φυσικά συστατικά υψηλής ποιότητας και καθαρότητας σε τιμές που μπορούν να ανταγωνιστούν τα φθηνά συνθετικά συστατικά που χρησιμοποιούνται σήμερα.', 6, 3, 3500, '2015-09-30 19:15:00', '2015-12-17 19:15:00', 0),
(6, 'Verde Wash', 'Verde Wash –Καθαριστικό φρούτων και λαχανικών. Παρασκευή καθαριστικού από 100% φυσικά συστατικά, για την αποτελεσματική απομάκρυνση υπολειμμάτων φυτοφαρμάκων, και άλλων παθογόνων παραγόντων από φρούτα και λαχανικά.', 9, 5, 3000, '2015-09-30 19:16:00', '2015-12-11 19:16:00', 0),
(7, 'Wave Winch', 'Wave Winch - Κυματικό Βαρούλκο για την παραγωγή ενέργειας. Παροχή υπηρεσιών σχεδιασμού προϊόντων και συστημάτων. Εμπορική εκμετάλλευση ευρεσιτεχνίας που αφορά σε ειδικό βαρούλκο για την παραγωγή ενέργειας από τον κυματισμό σκαφών ή πλωτών σωμάτων.', 30, 22, 6000, '2015-09-30 19:19:00', '2015-12-02 19:19:00', 0),
(8, 'Salesboxie', 'Salesboxie: Λογισμικό εύκολης διασύνδεσης eshop με E-bay. Προώθηση λογισμικού που συνδέει ταχύτατα τα ηλεκτρονικά καταστήματα με την διεθνή αγορά του eBay.', 5, 3, 5000, '2015-09-30 19:24:00', '2015-12-01 19:24:00', 0);

